App.prototype.registerErrorPopup = function(pageId) {
	var popupHtml = '<div id="'
			+ pageId
			+ '_ErrorPopup" data-role="popup" class="ui-body-b" data-theme="none" data-dismissible="false"><div data-role="header" class ="ui-header ui-bar-a" data-theme="b"><h1 class="ui-title">Error</h1>			<a href="#" class="ui-btn-left ui-btn ui-btn-c ui-icon-delete ui-corner-all ui-btn-icon-notext" data-rel="back"></a></div><div role="main" class="ui-content" data-theme="c" data-mini="true" style="margin-top: auto !important;"> <p id="error_msg" data-theme="c"></p></div></div>';
	$("#" + pageId).append(popupHtml);
	$('#' + pageId + '_ErrorPopup').popup();
}

App.prototype.showError = function(pageId, msg) {
	$('#' + pageId + '_ErrorPopup #error_msg').html(msg);
	$('#' + pageId + '_ErrorPopup').popup("open");
}

App.prototype.register = function() {
	var _self = this;

	$(document)
			.on(
					"pagecreate",
					"#pg_home",
					function(event) {
						// Check if already login
						_self.registerErrorPopup('pg_settings');
						_self.isLogin = false;
						_self.settingnview = new SettingsPage(_self);
						_self.settingnview.init();
						_self.appCache.addPage('pg_settings',
								_self.settingnview);
						var pageHeight = $('#pg_home').height();
						if ((pageHeight / 2) + 225 > pageHeight) {
							$('#pg_home .ui-content').css('margin-top',
									((pageHeight - 225) / 2));
						} else {
							$('#pg_home .ui-content').css('margin-top',
									(pageHeight / 2));
						}
						$("#btn_start")
								.on(
										'tap',
										function() {
											if (_self.appCache.settingInfo.is_login) {
												_self.isLogin = _self.appCache.settingInfo.is_login;
											}
											if (!_self.isLogin) {
												$.mobile
														.changePage("#pg_login")
											} else {
												// $.mobile.changePage("#pg_inspection");
												$(':mobile-pagecontainer')
														.pagecontainer(
																'change',
																'#pg_inspection',
																{
																	reload : false
																});
											}
										})
					});

	$(document).on(
			"pagecreate",
			"#pg_login",
			function(event) {
				_self.registerErrorPopup('pg_login');
				console.log("Login Called");
				// Height for content area is - 294
				var pageHeight = $('#pg_login').height();
				if ((pageHeight / 2) + 294 > pageHeight) {
					$('#pg_login .ui-content').css('margin-top',
							((pageHeight - 294) / 2));
				} else {
					$('#pg_login .ui-content').css('margin-top',
							(pageHeight / 2));
				}
				_self.loginview = new LoginPage(_self);
				_self.loginview.init();
			});

	$(document).on("pagecreate", "#pg_inspection", function(event) {
		_self.registerErrorPopup('pg_inspection');
		_self.inspLinePage = new InspLinesPage(_self);
		_self.inspLinePage.init();
		_self.appCache.addPage('pg_inspection', _self.inspLinePage);

		var visionApi = new VisionApi(_self);
		visionApi.getWaterMarkList(function(data) {
			_self.appCache.waterMarkImgs = data.responce;
			_self.loadWaterMarkFiles();
		}, function() {
			console.log("Error");
		});

		visionApi.getFTPServerList({
			'orgid' : _self.appCache.settingInfo.org_id
		}, function(result) {
			_self.appCache.ftpServers = [];
			$.each(result.ftpservers, function(index, data) {
				_self.appCache.ftpServers.push(data);
			});
		}, function() {
			console.log("Error");
		});
	});

	$(document).on("pagecreate", "#pg_aboutus", function(event) {
		_self.aboutusview = new AboutUsPage(_self);
		_self.aboutusview.init();
		_self.appCache.addPage('pg_aboutus', _self.aboutusview);
	});

	$(document).on("pagecreate", "#pg_inspection_detail", function(event) {
		_self.registerErrorPopup('pg_inspection_detail');
		_self.inspLinePage.loadInspLines({
			m_inoutline_id : _self.appCache.session.m_inoutline_id
		});
	});

	$(document).on("pagecreate", "#pg_gallery", function(event) {
		_self.registerErrorPopup('pg_gallery');
		_self.galleryview = new GalleryPage(_self);
		_self.galleryview.init();
		_self.appCache.addPage('pg_gallery', _self.galleryview);
		_self.registerErrorPopup('pg_img_editor');
		_self.imageEditor = new ImageEditorPage(_self);
		_self.imageEditor.init();
		_self.appCache.addPage('pg_img_editor', _self.imageEditor);
	});

	$(document).on("pagecreate", "#pg_file_explorer", function(event) {
		_self.registerErrorPopup('pg_file_explorer');
		_self.fileExplorer = new FileExplorerPage(_self);
		_self.fileExplorer.init();
		_self.appCache.addPage('pg_file_explorer', _self.fileExplorer);
	});

	$(document).on("click", "#btn_logout", function(event) {
		_self.logout();
	});
}

String.prototype.endsWith = function(s) {
	return this.length >= s.length && this.substr(this.length - s.length) == s;
}

if (typeof String.prototype.startsWith != 'function') {
	String.prototype.startsWith = function(str) {
		return this.slice(0, str.length) == str;
	};
}

App.prototype.logout = function() {
	var _self = this;
	_self.appCache.reset();
	var visSettingsDAO = new Tbl_VISSetting(this);
	visSettingsDAO.login("N", function(data) {
		console.log("DB-Logout Success!")
	}, function(msg) {
		console.log("DB-Logout Failed!")
	});
	$.mobile.changePage("#pg_login");
}

